    'https://cdn.jsdelivr.net/npm/echarts@5.4.1/dist/echarts.min.js',
    'https://lib.baomitu.com/echarts/5.4.1/echarts.common.js',
    'https://cdn.bootcdn.net/ajax/libs/echarts/5.4.1/echarts.common.js',
  ];

  function getCdnLink() {
    return new Promise((resolve, reject) => {
      const len = cdnLinks.length;
      let index = 0;
      const checkLink = () => {
        const script = document.createElement('script');
        script.src = cdnLinks[index];
        script.onload = () => {
          resolve(cdnLinks[index]);
        };
        script.onerror = () => {
          index++;
          if (index < len) {
            checkLink();
          } else {
            reject('所有cdn链接均不可用');
          }
        };
        document.head.appendChild(script);
      };
      checkLink();
    });
  }

  window.addEventListener('load', async () => {
    const cdnLink = await getCdnLink();
    const script = document.createElement('script');
    script.src = cdnLink;
    document.head.appendChild(script);
  });</script></body></html>
